import { useState } from 'react';

import './App.css';

function App() {
  const [password,setPassword] = useState()
const handleChange=(e)=>{
     setPassword(e.target.value)
}

  return (
    <div className="wrapper">
      <div className='box'>
       <form>
         <input placeholder='enter password' value={password} onChange={handleChange}/>
         <button>CHECK</button>
         <p>{password}</p>
       </form>
      </div>
    </div>
  );
}

export default App;
